#include<iostream>
#include<stdio.h>
using namespace std;
long long a,b,n,k,num;
int main()
{
    freopen("power.in","r",stdin);
    freopen("power.out","w",stdout);
    cin>>n>>k;
    for(int i=0;i<n;i++)
    {
        int tem=0;
        for(int j=1;j<n*n;j++)
        while(tem<=k)
        {
            if(tem==i)
            {
                num++;
                break;
            }
            tem*=j;
        }
    }
    cout<<num;
    fclose(stdin);
    fclose(stdout);
    return 0;
}
